import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      	<Grid />
      </div>
    );
  }
}

class Grid {
	render() {
		return (<h1>hiii</h1>);
	}
}

export default App;
